import React from 'react';

const card = (props) => {
    return (
        <div className =" tc bg-light-green dib br3 ma2 grow bw2 shadow5">

          <img alt ="robots" src="https://robohash.org/test?200*200" />
          <div>
            <h2> {props.name}</h2>
            <p>{props.email}</p>
           </div>
        </div>
    );

}
export default card;
